import {BrowserRouter as Router,Route,NavLink} from "react-router-dom";
import React,{Component} from 'react';
import EmployeePersonalDetails from '../components/EmployeeMasterPersonal';
import EmployeeMasterBank from '../components/EmployeeMasterBank';
import EmployeeMasterIdentification from '../components/EmployeeMasterIdentification';
import EmployeeMasterOffice from '../components/EmployeeMasterOffice';
import parser from 'json-schema-parser';

export default class EmployeeMasterRoute extends Component{
    constructor(props){
        super(props);
        const Personal = (props) =>{
                    return (
                            <EmployeePersonalDetails employeeMasterSchema = {parser.parse(this.props.EmployeeSchema).properties.EmployeeMasterPersonal} />
                    )
            }

    }

    render(){
        return(

                            <Router>
                                <div>

                                <div className='tab-pane'>
                                    <NavLink to = {'/EmployeePersonalDetails'} className = 'border p-2 m-2'>Personal</NavLink>
                                    <NavLink to = {'/EmployeeMasterBank'} className = 'border p-2 m-2'>Bank</NavLink>
                                    <NavLink to = {'/EmployeeMasterIdentification'} className = 'border p-2 m-2'>Identification</NavLink>
                                    <NavLink to = {'/EmployeeMasterOffice'} className = 'border p-2 m-2'>Office</NavLink>
                                </div>
                                <div className='container m-5'>
                                    <Route path = '/EmployeePersonalDetails' component = {Personal}/>
                                    <Route path = '/EmployeeMasterBank' component = {EmployeeMasterBank} />
                                    <Route path = '/EmployeeMasterIdentification' component = {EmployeeMasterIdentification} />
                                    <Route path = '/EmployeeMasterOffice' component = {EmployeeMasterOffice} />
                                </div>
                                    </div>
                            </Router>

        )
    }
}
